import React from 'react';

function LoginFunc() {
    return (
        <section>

                <h2>Login</h2>
                <form>   
                <input type='text'>Username</input>
                <input type='text'>Password</input>
                <button type='submit'>Submit</button>
            </form>
        </section>
    )
}

export default LoginFunc;
